from base64 import b64decode

def iconbit():
    __icon__ = b''
    with open('icon.ico', 'wb') as file:
        file.write(b64decode(__icon__))
        file.close()

__openfile__ = b''


def saveOpenFileImage():
    global __openfile__
    with open('icon_open_file.png', 'wb') as file:
        file.write(b64decode(__openfile__))
        file.close()
